import React from 'react';
const TodoItem = (props) => {
  const onCheck = () => {
    if (document.getElementById("myCheck").checked === true) {
      return true
    }
    else {
      return false;
    }
  }
  return (
    <div>
      <input type='checkbox' id='myCheck' onClick={()=>onCheck()}/>
      <label id='content'>
        {onCheck ? (<strike>{props.item.content}</strike>):props.item.content}
      </label>
      <button type='button' onClick={()=>props.onSubmitDelete(props.item.id)}>Delete</button>
    </div>
  );
}
export default TodoItem;
